import { Box, Typography, List, ListItem, IconButton, ListItemAvatar, ListItemText, Avatar, Divider } from "@mui/material"

const MealPlan = ({ item, icon }) => {
    return (

        <Box id="Upcoming Plans" sx={{
            bgcolor: 'background.paper',
            width: '100%', display: 'flex',
            flexDirection: 'column',
            color: 'text.primary',
            margin: '2rem',
            borderRadius: '10px'
        }}>
            <Typography varient="h2" component="h2" align="center" sx={{ color: 'white', fontWeight: 'bold', fontSize: '2rem' }} color="primary.light" >Upcoming Plans</Typography>

            <ListItem sx={{ backgroundColor: 'primary.main', border: 'solid 3px', borderColor: 'primary.main', my: '1.0rem', borderRadius: '10px', mx: 'auto', width: '85%', height: '4rem' }}
                secondaryAction={
                    <IconButton edge="end" aria-label="delete">
                        {icon}
                    </IconButton>
                }
            >
                <ListItemText
                    primary={item[0]}
                    disableTypography
                    sx={{ color: 'background.paper', fontFamily: 'Roboto', fontWeight: '900' }}
                />
                {item.length > 1 &&
                    <ListItemText
                        primary={item[1]}
                        disableTypography
                        sx={{ color: 'background.paper', fontFamily: 'Roboto', fontWeight: '900' }}
                    />
                }
            </ListItem>

        </Box>
    )
}

export default MealPlan
